import {
  createBrowserRouter,
  RouterProvider,
  Route
}from "react-router-dom";
import Customer from "./pages/Customer"
import Home from "./pages/Home"
import Maker from "./pages/Maker"
import "./style.scss"
const router = createBrowserRouter([
  {
    path: "/",
    element: <Home></Home>,
  },
  {
    path: "/maker",
    element: <Maker></Maker>,
  },
  {
    path: "/customer",
    element: <Customer></Customer>,
  }
]);
function App() {
  return (
    <div>
      <RouterProvider router={router}/>
    </div>
  );
}


export default App;
